  [],\n\t\"revision_timestamp\": \"2015-11-25T17:32:43.802337\",\n\t\"name\": \"npp-grassland-konza-prairie-usa-1984-1990-r1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains three ASCII files
  (.txt format). Two files contain above-ground biomass and productivity data for
  a humid temperate tall-grass prairie grassland located in the Konza Prairie Natural
  Research Area, Kansas. One file provides data for an unburned treatment and the
  other for a burned treatment for 1975 to 1990. The third file contains climate data
  for the period 1891-1988 obtained from a weather station at Konza. The above-ground
  net primary productivity measurement presented here (394 g/m2/year) is a 10-year
  average (1975-1984) based on peak seasonal live biomass values averaged for burned
  and unburned lowland and upland grasslands. The Konza study site (39.10 N, - 96.61
  W, Elevation 400 m) is situated near the town of Manhattan in north-eastern Kansas,
  about 170-km west of Kansas City. The Konza research program is built upon a long-term
  database on ecological pattern and process data derived from a fully replicated
  watershed-level experimental design, in place at the Konza Prairie Biological Station
  since 1977. This design includes replicate watersheds subject to different fire
  and grazing treatments. Within the watersheds, permanent sampling transects are
  replicated at various topographic positions, where plant species composition, plant
  and consumer populations, above-ground net primary production (ANPP), soil properties,
  and other key above- and below-ground processes are measured. In addition to these
  watershed-level studies, the Konza Long Term Ecological Research (LTER) program
  includes a number of long-term plot-level experiments. \",\n\t\"license_title\":
